css:
.select-list.popover-list.popover-list-subtle {
  background-color: transparent;
  border: none;
  border-radius: 0;
  box-shadow: none;
  padding: 0;
  /*
   * Beat specificity of `.select-list.popover-list atom-text-editor` to ensure subtle dropdowns
   * have no bottom margin.
   */
}
.select-list.popover-list.popover-list-subtle atom-text-editor[mini] {
  margin-bottom: 0;
}
.select-list.popover-list-subtle > ol.list-group {
  background: #2e2e2e;
  border: 1px solid #1c1c1c;
  border-top: none;
  margin-top: 0;
  position: absolute;
  width: 100%;
  z-index: 1;
}
.select-list.popover-list-subtle > ol.list-group strong {
  font-weight: bold;
}
